import numpy as np

class Solution:
    def productExceptSelf(self, nums: list[int]) -> list[int]:
        zeros = nums.count(0)
        if zeros > 1:
            return [0 for i in nums]
        else:
            prod = int(np.prod([i for i in nums if i != 0]))
            if zeros == 1: return [0 if i != 0 else prod for i in nums]
            else: return [prod//i for i in nums]
            
    
